  // }

  // useEffect(() => {
  //   setTimeout((index) => {
  //     const wordSlider=imgs[index];
  //     setWordData(wordSlider)
  //   }, 3000);
  // });
const slidesData = [
    {
        id: 1,
        title: 'repellendus id ullam',
        img: '../../img/l1.webp',
        label: 'Dolorem officiis temporibus. 0'
    },
    {
        id: 2,
        title: 'repellendus id ullam',
        img: '../../img/r1.webp',
        label: 'Dolorem officiis temporibus'
    },
    {
        id: 3,
        title: 'repellendus id ullam',
        img: '../.././img/r1.webp',
        label: 'Dolorem officiis temporibus'
    },
    {
        id: 4,
        title: 'repellendus id ullam',
        img: '../../img/l1.webp',
        label: 'Dolorem officiis temporibus'
    },
];
const PreviousBtn = (props) => {
    // console.log(props);
    const { className, onClick } = props;
    return (
      <div className={className} onClick={onClick}>
        <ArrowBackIos style={{ color: "blue", fontSize: "30px" }} />
      </div>
    );
  };
  const NextBtn = (props) => {
    const { className, onClick } = props;
    return (
      <div className={className} onClick={onClick}>
        <ArrowForwardIos style={{ color: "blue", fontSize: "30px" }} />
      </div>
    );
  };
  return (
    <div className="slider-wrapper">

<Slider
  {...settingsMain}
  asNavFor={nav2}
  ref={slider => (setSlider1(slider))}
>

  {slidesData.map((slide) =>

    <div className="slick-slide" key={slide.id}>
      {/* <h2 className="slick-slide-title">{slide.title}</h2> */}
      <img className="slick-slide-image" src={slide.img} alt=''/>
      {/* <label className="slick-slide-label">{slide.label}</label> */}
    </div>

  )}

</Slider>
<div>
  <Slider
    {...settingsThumbs}
    asNavFor={nav1}
    ref={slider => (setSlider2(slider))}>

    {slidesData.map((slide) =>

      <div >
        {/* <img className="slick-slide-image" src={`https://picsum.photos/800/400?img=${slide.id}`} /> */}
        <label>{slide.label}</label>
      </div>

    )}

  </Slider>
</div>
<Slider
        autoplay
        autoplaySpeed={2000}
        // dots
        initialSlide={2}
        infinite
        prevArrow={<PreviousBtn />}
        nextArrow={<NextBtn />}
        customPaging={(i) => {
          return (
            <div>
              <img
                src={slidesData.label}
                alt=""
                style={{
                  width: "50px",
                  height: "50px",
                  objectFit: "cover",
                  borderRadius: "10px",
                }}
              />
            </div>
          );
        }}
        dotsClass="slick-dots custom-indicator"
      >
        {slidesData.map((item) => (
          <div>
            <img src={item} alt="" style={{ width: "100%", height: "40vh" }} />
          </div>
        ))}
      </Slider>
</div>


  )

}

export default Center_menu
